WHERE c.url=url AND c.token=e.token;
END$$

CREATE DEFINER=`minervatech`@`localhost` PROCEDURE `vista_etapa_opciones_n_opciones` (IN `id` INT)  BEGIN

SELECT COUNT(*)/3
FROM etapa_opcion eo
WHERE eo.etapa_id=id;

END$$

